  const [middlePage, setMiddlePage] = useState(page)

  const showPage = (number: number) => {
    setMiddlePage(number)
  }

  return (
    <div className='Story'>
      <h1>Story</h1>
      <button onClick={() => showPage(1)}>Go to s</button>
    </div>
  )
}

export default Story
